import React from "react";
import "./style.css";
import ArrorSvg from "../../../../svg/MainArror";
import { Link } from "react-router-dom";
import mainButtomIcons from "../../../../svg/mainIconsSvg";

export default function StartPage() {
  return (
    <div className="start-screen">
      <div className="start-h1h2">
        <h1>ZAMYSHLIAEV NIKITA</h1>
      </div>

      <div>
        <Link className="main-page-links" to={"/works"}>
          My projects
        </Link>
        <Link className="main-page-links" to={"/contacts"}>
          <span className="svg-container">
            {mainButtomIcons("20", "#ffff", "one").codeSvg}
            {mainButtomIcons("20", "#ffff", "two").heartSvg}
            {mainButtomIcons("20", "#ffff", "three").reactSvg}
            {mainButtomIcons("20", "#ffff", "four").workSvg}
          </span>
          <h className="hire-me-words">Hire me</h>
        </Link>
      </div>
      <ArrorSvg width={100} />
    </div>
  );
}
